import React from 'react';
import projectElements from '../assets/projectElements';

export default function ProjectCard() {
    return (
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6 p-6">
            {projectElements.map((element) => {
                return (
                    <div key={element.id} className="relative px-6 py-6 cursor-pointer rounded-lg top-0 bg-[#2b2b2b]">
                        <a href={element.a} target="_blank" rel="noopener noreferrer">
                            <div className='service-thumb'>
                                <i className={`${element.icon} text-5xl text-white mb-4`}></i>
                                <h1 className='text-white text-xl font-bold pb-4'>{element.title}</h1>
                                <p className='text-[#a3a3a3] font-medium leading-6 tracking-[0.2px] mb-4'>{element.description}</p>
                                <div className='flex flex-wrap'>
                                    {element.tech.map((tech, index) => {
                                        return (
                                            <span
                                                key={index}
                                                className='mr-2 mb-2 px-3 py-1 border border-solid border-[#d9d9d9] rounded-full bg-[#2b2b2b] text-[#d9d9d9] text-sm'
                                            >
                                                {tech}
                                            </span>
                                        );
                                    })}
                                </div>
                            </div>
                        </a>
                    </div>
                );
            })}
        </div>
    );
}
